class Solution:
    def maxOperations(self, s: str) -> int:
        z = 0
        res = 0
        n = len(s)
        for i in reversed(range(n-1)):
            if s[i] == '1' and s[i+1] == '0':
                z += 1
            if s[i] == '1':
                res += z
        return res
